-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `userid` int(255) NOT NULL AUTO_INCREMENT,
  `countrynum` varchar(255) COLLATE utf8_bin DEFAULT '86' COMMENT '国家区号',
  `tel` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '账号（手机号）',
  `phonecountrynum` varchar(255) COLLATE utf8_bin DEFAULT '',
  `phone` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '手机号码',
  `password` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '登陆密码',
  `username` varchar(255) COLLATE utf8_bin DEFAULT '' COMMENT '用户昵称',
  `headimg` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '用户头像',
  `professionsign_id` int(255) DEFAULT NULL COMMENT '职业id',
  `sex` int(2) DEFAULT NULL COMMENT '性别  1|男 2|女',
  `age` int(11) DEFAULT NULL COMMENT '年龄（岁）',
  `height` int(11) DEFAULT NULL COMMENT '身高（cm）',
  `weight` int(11) DEFAULT NULL COMMENT '体重（Kg）',
  `constellation` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '星座',
  `hobbyid` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '爱好id ，使用#id| 分开',
  `starsignid` varchar(255) COLLATE utf8_bin DEFAULT '' COMMENT '标签id ,多个，#id|',
  `guide` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '引荐者语',
  `autograph` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '个性签名',
  `addtime` int(11) DEFAULT NULL COMMENT '注册时间（时间戳）',
  `user_hx` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '用户环信好友账号',
  `user_hx_airship_id` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '空间站环信id',
  `user_hx_id` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '用户好友环信id',
  `user_hx_airship` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '用户环信空间站账号',
  `user_hx_password` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '用户环信密码',
  `status` int(3) DEFAULT NULL COMMENT '账户状态  1|正常 2|冻结',
  `kj_status` int(3) DEFAULT '0' COMMENT '空间站接收消息状态  0|接收 1|不接收',
  `pid` int(255) DEFAULT '0' COMMENT '邀请者id',
  `pcon` text COLLATE utf8_bin COMMENT '层级树，使用#userid|',
  `paypassword` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '钱包支付密码',
  `memberstatus` int(2) DEFAULT '0' COMMENT '会员状态 0|非会员 1|会员',
  `balance` decimal(12,2) DEFAULT '0.00' COMMENT '余额',
  `level` int(255) DEFAULT '1' COMMENT '用户等级',
  `now_growth_value` int(255) DEFAULT '0' COMMENT '等级当前成长值',
  `marriage` varchar(255) COLLATE utf8_bin DEFAULT '保密' COMMENT '婚姻状况',
  `soundstatus` int(2) DEFAULT '0' COMMENT '是否屏蔽声音  0|不屏蔽1|屏蔽',
  `number` varchar(255) COLLATE utf8_bin DEFAULT '' COMMENT '推荐码',
  `number_user` int(20) DEFAULT '0' COMMENT '成功使用的推荐码个数  最多11个',
  `system_msg` int(255) DEFAULT '0' COMMENT '接收系统消息  0接收 1不接收',
  `device` varchar(255) COLLATE utf8_bin DEFAULT '' COMMENT '设备id  json数组 device--设备名  ',
  `number_user_id` int(11) DEFAULT '0' COMMENT '推荐人的id（推荐码)',
  `black` int(255) DEFAULT '0' COMMENT '0 正常 1加入黑名单',
  `air_language` int(255) unsigned DEFAULT '1' COMMENT '星际语言 0关闭 1启用',
  `apply` int(255) unsigned DEFAULT '0' COMMENT '官网申请 0 待审核 1审核失败 2审核通过',
  `add_status` int(255) DEFAULT '0' COMMENT '0 后台添加 1官网申请',
  `apply_time` int(255) DEFAULT '0' COMMENT '用户申请时间',
  `real_name` varchar(255) COLLATE utf8_bin DEFAULT '' COMMENT '真实姓名',
  `type` int(255) unsigned DEFAULT '0' COMMENT '0 一般用户 1商家',
  PRIMARY KEY (`userid`)
) ENGINE=InnoDB AUTO_INCREMENT=109 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='用户信息表';

