  `planet_posts_message_id` int(255) NOT NULL AUTO_INCREMENT,
  `userid` int(11) NOT NULL COMMENT '点赞\\评论用户id',
  `beuserid` int(11) NOT NULL COMMENT '被点赞\\评论用户id',
  `message` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '提示信息',
  `isread` int(11) NOT NULL DEFAULT '1' COMMENT '是否已读 1|未读2|已读',
  `addtime` int(11) NOT NULL COMMENT '添加时间(时间戳)',
  `posts_id` int(11) NOT NULL COMMENT '星球贴id',
  PRIMARY KEY (`planet_posts_message_id`)
) ENGINE=InnoDB AUTO_INCREMENT=373 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='星球贴点赞、评论提示信息表';

